  "manifest_version": 3,
  "name": "Webpage Screenshot",
  "version": "1.0",
  "action": {
    "default_popup": "screenshot.html"
  },
  "permissions": [
    "activeTab",
    "storage",
    "downloads",
    "<all_urls>"
  ],
  "background": {
    "service_worker": "background.js"
  },
  "content_scripts": [
    {
      "matches": ["<all_urls>"],
      "js": ["content_script.js"]
    }
  ],
  "icons": {
    "16": "icon16.png",
    "48": "icon48.png",
    "128": "icon128.png"
  }
